import React from "react";
const SearchCoursePage = (props) => {
  return (
    <div>
      <input
        style={{ marginTop: "40px", marginBottom: "20px", marginLeft: "300px" }}
        type="search"
        placeholder="Search......"
        value={props.SearchInp}
        onChange={props.handleSearch}
      />
    </div>
  );
};
export default SearchCoursePage;
